import supertest from 'supertest';
import { expect } from 'chai';


const request = supertest('https://gorest.co.in/public/v1/');
const token = 'Bearer ea7b32fb4b3e6ade4d982d8f186f4a40ad113d247427eebf5c136365192552bb';
let data = {
    name: 'Name',
    email: `random_email${Math.floor(Math.random() * 999)}@gmail.com`,
    gender: 'female',
    status: 'active'
}
let id;

describe('Users', () => {
    it('GET /users', (done) => {
        request.get('users').end((err, res) => {
            expect(res.status).to.equal(200);
            expect(res.body).to.have.all.keys('meta', 'data').to.be.an('object').that.is.not.empty;
            expect(res.body.data).to.be.an('array').that.is.not.empty;
            res.body.data.forEach(data => {
                expect(data).to.have.all.keys('id', 'name', 'email', 'gender', 'status').to.be.an('object').that.is.not.empty;
                expect(data.id).to.be.a('number').above(0);
                expect(data.name).to.be.a('string').that.is.not.empty;
                expect(data.email).to.be.a('string').that.is.not.empty;
                expect(data.gender).to.be.a('string').that.is.not.empty;
                expect(data.status).to.be.a('string').that.is.not.empty;
            });
            done();
        });
    }).timeout(10000);

    it('POST /users', (done) => {
        request.post('users').set('Authorization', token).send(data).end((err, res) => {
            expect(res.status).to.equal(201);
            id = res.body.data.id;
            expect(id).to.be.a('number').above(0);
            expect(res.body.data).to.deep.include(data);
            done();
        });
    }).timeout(10000);

    it('GET /users/:id', (done) => {
        request.get(`users/${id}`).end((err, res) => {
            expect(res.status).to.equal(200);
            expect(res.body.data.id).to.equal(id);
            expect(res.body.data).to.deep.include(data);
            done();
        });
    }).timeout(10000);

    it('PUT /users/:id', (done) => {
        data = {
            name: 'New Name',
            email: `new_random_email${Math.floor(Math.random() * 999)}@gmail.com`,
            gender: 'male',
            status: 'inactive'
        }

        request.put(`users/${id}`).set('Authorization', token).send(data).end((err, res) => {
            expect(res.status).to.equal(200);
            expect(res.body.data.id).to.equal(id);
            expect(res.body.data).to.deep.include(data);
            done();
        });
    }).timeout(10000);

    it('DELETE /users/:id', (done) => {
        request.delete(`users/${id}`).set('Authorization', token).end((err, res) => {
            expect(res.status).to.equal(204);
            expect(res.body.data).to.not.exist;
            done();
        });
    }).timeout(10000);
});

